import React, { useState, useEffect } from 'react';
import { Container, Navbar, Nav, Button } from 'react-bootstrap';
import FuelForm from './components/FuelForm';
import FuelList from './components/FuelList';
import Dashboard from './components/Dashboard';
import Chatbot from './components/Chatbot';
import StationSearch from './components/StationSearch';
import AuthForm from './components/AuthForm';

function App() {
  const [user, setUser] = useState(null);
  const [activeTab, setActiveTab] = useState('dashboard');
  const [refreshList, setRefreshList] = useState(0);

  useEffect(() => {
    // Check for existing token
    const token = localStorage.getItem('token');
    if (token) {
      // Verify token with backend
      fetch(`${process.env.REACT_APP_API_URL || 'http://localhost:5000/api'}/auth/profile`, {
        headers: { 'Authorization': `Bearer ${token}` }
      })
      .then(res => res.json())
      .then(data => {
        if (data.error) {
          localStorage.removeItem('token');
        } else {
          setUser(data);
        }
      })
      .catch(() => localStorage.removeItem('token'));
    }
  }, []);

  const handleLogin = (userData, token) => {
    localStorage.setItem('token', token);
    setUser(userData);
  };

  const handleLogout = () => {
    localStorage.removeItem('token');
    setUser(null);
    setActiveTab('dashboard');
  };

  const handleEntrySaved = () => {
    setRefreshList(prev => prev + 1);
  };

  const handleStationSelect = (station) => {
    // You can implement logic to pre-fill the fuel form with selected station
    setActiveTab('add-fuel');
  };

  if (!user) {
    return <AuthForm onLogin={handleLogin} />;
  }

  return (
    <>
      {/* Navbar */}
      <Navbar bg="dark" variant="dark" expand="lg">
        <Container>
          <Navbar.Brand>Fuel Track AI</Navbar.Brand>
          <Nav className="ms-auto">
            <Nav.Text className="me-3">Welcome, {user.name}!</Nav.Text>
            <Button variant="outline-light" onClick={handleLogout}>Logout</Button>
          </Nav>
        </Container>
      </Navbar>

      {/* Main Content */}
      <Container className="mt-4">
        <div className="mb-4">
          <nav>
            <div className="nav nav-tabs" id="nav-tab" role="tablist">
              <button 
                className={`nav-link ${activeTab === 'dashboard' ? 'active' : ''}`}
                onClick={() => setActiveTab('dashboard')}
                type="button"
              >
                Dashboard
              </button>
              <button 
                className={`nav-link ${activeTab === 'add-fuel' ? 'active' : ''}`}
                onClick={() => setActiveTab('add-fuel')}
                type="button"
              >
                Add Fuel Entry
              </button>
              <button 
                className={`nav-link ${activeTab === 'fuel-list' ? 'active' : ''}`}
                onClick={() => setActiveTab('fuel-list')}
                type="button"
              >
                Fuel History
              </button>
              <button 
                className={`nav-link ${activeTab === 'chatbot' ? 'active' : ''}`}
                onClick={() => setActiveTab('chatbot')}
                type="button"
              >
                AI Assistant
              </button>
            </div>
          </nav>
          
          <div className="tab-content mt-3">
            {activeTab === 'dashboard' && <div>Dashboard Component</div>}
            
            {activeTab === 'add-fuel' && (
              <div className="row">
                <div className="col-md-6">
                  <div>Fuel Form Component</div>
                </div>
                <div className="col-md-6">
                  <div>Station Search Component</div>
                </div>
              </div>
            )}
            
            {activeTab === 'fuel-list' && <div>Fuel List Component</div>}
            
            {activeTab === 'chatbot' && <div>Chatbot Component</div>}
          </div>
        </div>
      </Container>
    </>
  );
}

export default App;
